// Calculate next invoice date for Celina property

// Contract details from Contracts sheet
const contractStart = 46082; // Excel date serial number
const monthlyRent = 1800;
const billingCycle = "monthly";
const notifyDays = 3;

// Convert Excel date to JavaScript Date
// Excel dates start from January 1, 1900
// JavaScript dates use milliseconds since January 1, 1970
function excelDateToJSDate(excelDate) {
  const excelEpoch = new Date(1900, 0, 1);
  const msPerDay = 24 * 60 * 60 * 1000;
  // Excel has a bug where it thinks 1900 was a leap year, so we need to subtract 2 days
  const jsDate = new Date(excelEpoch.getTime() + (excelDate - 2) * msPerDay);
  return jsDate;
}

// Contract start date
const startDate = excelDateToJSDate(contractStart);
console.log(`Contract Start Date: ${startDate.toDateString()} (${startDate.toISOString().split('T')[0]})`);

// Current date
const now = new Date();
console.log(`Current Date: ${now.toDateString()} (${now.toISOString().split('T')[0]})`);

// For monthly rent, determine the next due date
// Assuming rent is due on the same day of each month as the contract start
const startDay = startDate.getDate();

// Find the next due date (on or after today)
let nextDueDate = new Date(now.getFullYear(), now.getMonth(), startDay);
if (nextDueDate <= now) {
  // If we've passed this month's due date, move to next month
  nextDueDate = new Date(now.getFullYear(), now.getMonth() + 1, startDay);
}

console.log(`\nNext Rent Due Date: ${nextDueDate.toDateString()} (${nextDueDate.toISOString().split('T')[0]})`);

// Calculate invoice send date (notify_days before due date)
const invoiceDate = new Date(nextDueDate);
invoiceDate.setDate(invoiceDate.getDate() - notifyDays);

console.log(`Invoice Send Date: ${invoiceDate.toDateString()} (${invoiceDate.toISOString().split('T')[0]})`);
console.log(`\nNotification Setting: ${notifyDays} days before due date`);
console.log(`Monthly Rent Amount: $${monthlyRent}`);
console.log(`Tenant: Christian Lachausse`);
console.log(`Billing Cycle: ${billingCycle}`);
console.log(`Email: Christian@tjmfuneral.com`);

// Calculate days until invoice
const daysUntilInvoice = Math.ceil((invoiceDate - now) / (24 * 60 * 60 * 1000));
console.log(`\n⏰ Days until next invoice: ${daysUntilInvoice} day(s)`);

if (daysUntilInvoice < 0) {
  console.log(`\n⚠️  Invoice date has passed! The invoice should have been sent on ${invoiceDate.toDateString()}`);
} else if (daysUntilInvoice === 0) {
  console.log(`\n📧 Invoice should be sent TODAY!`);
} else {
  console.log(`\n📅 Next invoice will be sent on ${invoiceDate.toDateString()}`);
}
